import React from 'react';

const card = (props) => {
    return (
        <div className='tc grow bg-light-green dib br3 pa3 ma2 grow bw2 shadow-5'>
            <img alt='students' src={`https://robohash.org/${props.id}?200x200`} />
            <div>
                <h2>{props.name}</h2>
                <p>{props.email}</p>
            </div>
        </div>
    );
}

export default card;
